script: |
  super -f text -I q12596.spq | sort > q12596.out

inputs:
  - name: q12596.spq
    data: |
      SELECT DISTINCT col1 + - ( CAST ( NULL AS INTEGER ) ) AS col0 FROM tab0 (FORMAT parquet) WHERE ( + col2 + col0 ) BETWEEN - col2 AND col0 / col1;
  - name: tab0

outputs:
  - name: q12596.out
    data: |
